[{"location":"","page":"Home","title":"Home","text":"CurrentModule = CircuitComponentRounding","category":"page"},{"location":"#CircuitComponentRounding","page":"Home","title":"CircuitComponentRounding","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for CircuitComponentRounding.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [CircuitComponentRounding]","category":"page"},{"location":"#CircuitComponentRounding.roundE","page":"Home","title":"CircuitComponentRounding.roundE","text":"roundE(values_to_be_rounded, series)\nroundE(values_to_be_rounded, series, format)\n\nRound the values_to_be_rounded to the given E series number series. Possible series are 3, 6, 12, 24, 48, 96, 192.\n\nThe values come out as plain numbers, for easy use in further calculations. For prettier printing, an optional third argument formats the output by passing it to the function formatted from the package NumericIO. Possible formats include :SI and :ENG.\n\nExamples\n\njulia> vals = [3, 7e-7, 14e-2]\n3-element Vector{Float64}:\n 3.0\n 7.0e-7\n 0.14\n\njulia> roundE(vals, 24)\n3-element Vector{Float64}:\n 3.0\n 6.8e-7\n 0.15\n\njulia> roundE(vals, 24, :ENG)\n3-element Vector{String}:\n \"3.0×10⁰\"\n \"680×10⁻⁹\"\n \"150×10⁻³\"\n\njulia> roundE(vals, 24, :SI)\n3-element Vector{String}:\n \"3.0\"\n \"680n\"\n \"150m\"\n\n\n\n\n\n","category":"function"},{"location":"#CircuitComponentRounding.series_values-Tuple{Integer}","page":"Home","title":"CircuitComponentRounding.series_values","text":"series_values(ser)\n\nReturns the values in the E-series ser.\n\nExamples\n\njulia> series_values(3)\n3-element Vector{Float64}:\n 1.0\n 2.2\n 4.7\n\n\n\n\n\n","category":"method"}]
